import React, {Component} from "react";
import styled from "styled-components";

const StyledTarget = styled(TargetComponent)`
    opacity: 0.5;
`;

const Tip = TargetComponent => {
    const StyledTarget = styled(TargetComponent)`
        opacity: 0.5;
    `;
    return (<StyledTarget data-bs="now I'm a Higher Order Component!" {...this.props}/>);  
}

export default Tip;
